import '../css/items_exper.css'

const Experience=()=>{
    return(
        <div className="Experience-box">
            <video className='video' autoPlay muted controls>
                <source src='https://youtu.be/CY5WLrSYPzo?si=U0yyPlCwINogU16R'/>
            </video>
            <div  className="description">
                <h2>Title</h2>
                <p>A dragon is a mythical creature that appears in the folklore of many cultures around the world. While the exact characteristics of dragons can vary widely depending on cultural context, there are some common traits and themes:</p>
            </div>
        </div>
    );
}
export default Experience;
